settings\u0004Note: To disable a context:
Chú ý: Để vô hiệu hóa một mục của trình đơn ngữ cảnh,
sao chép nó vào Tùy chọn của Người dùng và thêm khóa
"disabled". Ví dụ sau sẽ vô hiệu hóa mục Tải về trên các tệp:
{
  "contextMenu": [
    {
      "command": "filebrowser:download",
      "selector": ".jp-DirListing-item[data-isdir=\"false\"]",
      "disabled": true
    }
  ]
}

Mô tả của trình đơn ngữ cảnh:

settings\u0004Overrides for where to sho:
Ghi đè cho vị trí hiển thị các mục của thanh bên
e.g., {"jp-debugger-sidebar": "left"}
Bạn cũng có thể thay đổi bằng cách nhấp phải vào biểu tượng thanh bên.
